INSERT INTO `sc_faq_content_description` VALUES (1,'en','Is S-Cart free?','','','Yes, S-Cart is free and open source for everyone.'),(1,'vi','S-Cart có miễn phí không?','','','Vâng, S-Cart là mã nguồn mở miễn phí cho tất cả mọi người.'),(2,'en','Does S-Cart only support shop building function?','','','No. We support e-commerce platforms for individuals and businesses. However, our goal will be greater than that. S-Cart will be a major ecosystem in the future.'),(2,'vi','Có phải S-Cart chỉ hỗ trợ chức năng xây dựng cửa hàng?','','','Không. Chúng tôi hỗ trợ nền tảng thương mại điện tử cho cá nhân, doanh nghiệp.  Tuy nhiên, mục tiêu của chúng tôi sẽ lớn hơn thế. S-Cart sẽ là một hệ sinh thái lớn trong tương lai.');
