INSERT INTO `sc_shop_page_description` VALUES (1,'en','About','Materiais Elétricos, Energia Solar, Automação industrial, Agronegócio, demais produtos e acessórios.','Somos uma empresa de aproximação buscamos o produto que você quer.  E aproximamos a oportunidade da satisfação de seu desejo.','<p><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:108%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\"><span style=\"font-size:10.0pt\"><span style=\"line-height:108%\"><span style=\"font-family:\" verdana=\"\"><span style=\"font-size:10.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:\" verdana=\"\"><span style=\"color:black\"><strong>Na &aacute;rea de Energia Fotovolt&aacute;ica</strong>, contamos com uma equipe pr&oacute;pria profissionais altamente treinados, qualificados e experientes, com mais de 600 usinas instaladas e operando. <strong>Os Instaladores s&atilde;o certificados nas normas NR-10 e NR-35, </strong>com treinamentos na f&aacute;brica da WEG em Jaragu&aacute; do Sul. </span></span></span></span><br />\r\nTrabalhamos com as melhores marcas mundiais de m&oacute;dulos fotovoltaicos, sendo todos com certifica&ccedil;&otilde;es nacionais e internacionais (Teir 1).<br />\r\n<strong>Na &aacute;rea de materiais el&eacute;tricos,</strong> trabalhamos com solu&ccedil;&otilde;es de primeira linha e com cabos bitolados.<br />\r\n<u>Promovemos tamb&eacute;m a venda de diversos produtos materiais e acess&oacute;rios para satisfazer a sua necessidade de consumo.</u></span></span></span></span></span></span></span></span><br />\r\n&nbsp;</p>'),(1,'pt-br','Sobre Nós','Materiais Elétricos, Energia Solar, Automação industrial, Agronegócio, demais produtos e acessórios.','Somos uma empresa de aproximação buscamos o produto que você quer.  E aproximamos a oportunidade da satisfação de seu desejo.','<span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:108%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\"><span style=\"font-size:10.0pt\"><span style=\"line-height:108%\"><span style=\"font-family:\" verdana=\"\"><span style=\"font-size:10.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:\" verdana=\"\"><span style=\"color:black\"><strong>Na &aacute;rea de Energia Fotovolt&aacute;ica</strong>, contamos com uma equipe pr&oacute;pria profissionais altamente treinados, qualificados e experientes, com mais de 600 usinas instaladas e operando. <strong>Os Instaladores s&atilde;o certificados nas normas NR-10 e NR-35, </strong>com treinamentos na f&aacute;brica da WEG em Jaragu&aacute; do Sul. </span></span></span></span><br />\r\nTrabalhamos com as melhores marcas mundiais de m&oacute;dulos fotovoltaicos, sendo todos com certifica&ccedil;&otilde;es nacionais e internacionais (Teir 1).<br />\r\n<strong>Na &aacute;rea de materiais el&eacute;tricos,</strong> trabalhamos com solu&ccedil;&otilde;es de primeira linha e com cabos bitolados.<br />\r\n<u>Promovemos tamb&eacute;m a venda de diversos produtos materiais e acess&oacute;rios para satisfazer a sua necessidade de consumo.</u></span></span></span></span></span></span></span></span><br />\r\n<br />\r\n&nbsp;');
